class=\"innerbox\">\n<div class=\"resetcss\">\n<p>Natychmiast po złożeniu przez Ciebie zamówienia otrzymasz e-mail z potwierdzeniem złożonego zamówienia i linkiem, w który należy kliknąć. Po otrzymaniu akceptacji zamówienia rozpoczynamy jego realizację, a Ty będziesz na bieżąco informowany o postępie naszych prac.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>Termin otrzymania paczki = termin wysyłki + czas dostawy</strong></h3>\n<p> </p>\n<p>Termin wysyłki wynika z <strong>dostępności produktów</strong> i wybranej <strong>formy płatności</strong>, podczas gdy czas dostawy zależy od wybranej przez Ciebie <strong>formy dostawy</strong>.</p>\n<p style=\"text-align:center;\"><span style=\"color:#ff0000;\"><strong> </strong></span></p>\n<h3>Dostępność produktów</h3>\n<p> </p>\n<p>Przy każdym produkcie jest podany termin, który opisuje, kiedy produkty mogą zostać przez nas wysłane - od 24 godzin do kilku, czasami nawet kilkunastu dni (w przypadku produktów trudno dostępnych), podane terminy dotyczą dni roboczych. Dokładamy wszelkich starań, aby oferta prezentowana na stronie odpowiadała realnym stanom magazynowym, może się jednak zdarzyć, że faktyczny czas dostawy się przedłuży - poinformujemy o tym niezwłocznie.</p>\n<p>Jeżeli zamawiasz większą liczbę produktów, czas wysyłki całego zamówienia jest dopasowany do produktu o najdłuższym czasie wysyłki. Można zrealizować zamówienie etapami - w tym celu skontaktuj się z nami lub wpisz odpowiednią adnotację w uwagach do zamówienia.</p>\n<p> </p>\n<h3>Forma płatności</h3>\n<p>W chwili obecnej jedyną możliwością opłaty zamówienia jest płatność przelewem.</p>\n<p>Płatność przelewem - czas realizacji zamówienia jest uzależniony od momentu zaksięgowania wpłaty. W zależności od banku standardowo trwa to do dwóch dni roboczych.</p>\n<p> </p>\n<p style=\"text-align:right;\"><strong>» <a href=\"7-formy-platnosci\">formy płatności</a> </strong></p>\n<p> </p>\n<h3>Forma dostawy</h3>\n<p> </p>\n<p>Poczta Polska zazwyczaj dostarcza przesyłki w ciągu deklarowanych 2 dni roboczych przesyłką priorytetową lub 3-5 dni przesyłką ekonomiczną.</p>\n<p style=\"text-align:right;\"><strong>» <a href=\"8-koszt-dostawy\">koszt dostawy</a></strong></p>\n</div>\n</div>\n<p></p>','czas-realizacji-zamowienia'),(6,2,1,'Czas realizacji zamówienia','','','','','czas-realizacji-zamowienia'),(7,1,1,'Formy płatności','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<p>Płatności za zamówienia można dokonywać przelewem na nr konta 85 1870 1045 2078 1146 0222 0001 z podaniem numeru zamówienia i danych klienta lub za pośrednictwem operatorów płatności Autopay S.A. i PayPro.Typy obsługiwanych kart płatniczych: Visa, Visa Electron, Maestro, MasterCard, MasterCard Electronic.</p>\n</div>\n</div>','formy-platnosci'),(7,2,1,'Formy płatności','','','','','formy-platnosci'),(8,1,1,'Koszty dostawy','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<p>W zależności od ilości i wagi zamawianych przez Ciebie produktów, wybranej formy płatności i własnych preferencji, możesz wybrać jedną z form dostawy:</p>\n<p><strong>Najwygodniej, najtaniej, najszybciej, najłatwiej, wybierz jak chcesz.</strong><br /><br /></p>\n<p>Odbiór osobisty ­to najłatwiejszy sposób odbioru zamówionych towarów - zapraszamy do sklepu stacjonarnego w <strong>Gdańsku przy ul. Grunwaldzkiej 515, </strong>po otrzymaniu powiadomienia o gotowości zamówienia<strong>. </strong>Przy odbiorze osobistym nie ponosisz dodatkowych kosztów.</p>\n<p> </p>\n<h3>Koszt dostawy</h3>\n<p>Całkowity koszt dostawy zamówienia poznasz po dodaniu produktów do koszyka i wybraniu interesującej Ciebie formy dostawy i metody płatności - w podsumowaniu zobaczysz dokładną wartość do zapłaty. Poniżej znajdziesz listę standardowych kosztów dostawy, wraz z szacunkowym czasem dostarczenia zamówienia:</p>\n<table style=\"margin-left:auto;margin-right:auto;text-align:center;border:1px solid #888888;width:582px;height:314px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"7\">\n<thead>\n<tr style=\"background-color:#ddd;\">\n<th>\n<p>Sposób dostawy</p>\n</th>\n<th>\n<p>Przedpłata<br /><span style=\"font-size:x-small;\">(przelew)</span></p>\n</th>\n<th>\n<p>Czas dostarczenia<span style=\"font-size:x-small;\"> <br />(szacowany)<br /></span></p>\n</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>\n<p><strong>Paczkomaty InPost</strong></p>\n</td>\n<td valign=\"middle\">\n<p>15 zł</p>\n</td>\n<td valign=\"middle\">\n<p>1-2 dni robocze</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong><strong>Poczta Polska</strong></strong></p>\n<p>(paczka pocztowa)<strong><strong><br /></strong></strong></p>\n</td>\n<td valign=\"middle\">\n<p>22 zł</p>\n</td>\n<td valign=\"middle\">\n<p>do 3 dni roboczych</p>\n</td>\n</tr>\n<tr>\n<td><strong>DHL</strong></td>\n<td valign=\"middle\"> 24 zł</td>\n<td valign=\"middle\">24h</td>\n</tr>\n<tr>\n<td><strong>Kurier InPost</strong></td>\n<td valign=\"middle\">20 zł</td>\n<td valign=\"middle\">1 dzień roboczy</td>\n</tr>\n<tr>\n<td>\n<p><strong>Odbiór osobisty w Gdańsku <br /></strong></p>\n</td>\n<td valign=\"middle\">\n<p>bezpłatnie</p>\n</td>\n<td valign=\"middle\">2 dni robocze<strong><br /></strong></td>\n</tr>\n</tbody>\n</table>\n<p><strong><br /> </strong></p>\n<p><strong>Uwaga: </strong>koszt dostawy może ulec zwiększeniu w przypadku produktów o niestandardowych gabarytach i/lub większej wadze.</p>\n</div>\n</div>\n<p></p>','koszty-dostawy'),(8,2,1,'Koszty dostawy','','','','','koszty-dostawy'),(9,1,1,'Reklamacje i zwroty','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<h3>Gwarancja</h3>\n<p> </p>\n<p>Część produktów sprzedawanych w naszym sklepie posiada gwarancję producenta. W przypadku wykrycia wady w sprzęcie objętym gwarancją, skontaktuj się z nami.</p>\n<p>Uwaga: prosimy o zachowanie dowodu zakupu (paragon lub faktura) i oryginalnego opakowania aż do momentu zakończenia okresu gwarancyjnego - stanowią one podstawę do zgłaszania reklamacji.</p>\n<p> </p>\n<h3>Reklamacje</h3>\n<p> </p>\n<p>Przed odebraniem przesyłki zawsze sprawdź, czy nie uległa uszkodzeniu w transporcie. Jeżeli opakowanie posiada widoczne uszkodzenia zewnętrzne, zalecamy odmówienia przyjęcia przesyłki, a następnie skontaktowanie się z nami pod numerem telefonu: <strong>+48.600256864</strong>.</p>\n<p>Po opłaceniu kwoty pobrania i pokwitowaniu odbioru paczki istnieje możliwość otwarcia paczki w obecności kuriera - w przypadku stwierdzenia niezgodności, sporządzany jest protokół rozbieżności, który stanowi podstawę późniejszej reklamacji.</p>\n<p>Jeżeli zakupiony towar okazuje się mieć wady fabryczne lub jest niezgodny z opisem, prosimy o postępowanie zgodnie z poniższą procedurą reklamacyjną:</p>\n<ol>\n<li>Prześlij do nas produkt, który chcesz zareklamować, dołączając do niego pisemne oświadczenie,<em> </em>w którym opiszesz szczegółowe powody reklamacji produktu, formę rekompensaty, a także adres zwrotny oraz numer konta, na który zostanie dokonany zwrot pieniędzy (w zależności od podjętej przez sklep decyzji).</li>\n<li>W <strong>ciągu 14 dni</strong> od otrzymania przesyłki poinformujemy Cię mailowo lub telefonicznie o wyniku postępowania reklamacyjnego.</li>\n<li>Jeżeli reklamacja zostanie rozpatrzona pozytywnie, w <strong>ciągu 7 dni</strong> roboczych od dnia podjęcia decyzji, zrekompensujemy poniesione przez Ciebie koszty poprzez: naprawę reklamowanego produktu, przesłanie nowego egzemplarza produktu lub zwrot pieniędzy.</li>\n<li>Jeżeli reklamacja zostanie uznana za nieuzasadnioną, przekażemy Ci szczegółowe uzasadnienie podjętej decyzji i w <strong>ciągu 14 dni</strong> roboczych odeślemy na nasz koszt reklamowany produkt. W przypadku płatności kartą płatniczą zwrot środków zostanie wykonany na kartę.</li>\n</ol>\n<p> </p>\n<p>W razie wątpliwości, zapraszamy do kontaktu pod adresem e-mail: <strong>kontakt@motkomania.pl</strong> lub telefonicznie: <strong>+48.600256864</strong>. Udzielimy Ci wskazówek, jak szybko i bezproblemowo przeprowadzić reklamację.</p>\n<p> </p>\n<h3>Zwrot produktów</h3>\n<p> </p>\n<p>Zgodnie z obowiązującymi przepisami, w ciągu 14 dni kalendarzowych od daty dostarczenia zamówionego towaru, masz prawo jego zwrotu bez podania przyczyn w ramach odstąpienia od umowy, wg ogólnych zasad wynikających z przepisów dotyczących zawierania umów na odległość. Dotyczy to wyłącznie sprzedaży konsumenckiej, a więc stosuje się tylko do sprzedaży osobie fizycznej, która dokonuje zakupu w celu niezwiązanym z działalnością zawodową lub gospodarczą. </p>\n<p>Zwracany produkt nie może nosić śladów używania - każdy element musi być kompletny i fabrycznie zapakowany, towar dostarczony w oryginalnym opakowaniu w stanie niezmienionym. W przypadku niespełnienia tego warunku, produkt nie zostanie przyjęty.</p>\n<p style=\"text-align:justify;\"> </p>\n<p> </p>\n<div style=\"text-align:center;\">\n<h1>Zasady zwracania zakupów</h1>\n</div>\n<div style=\"text-align:justify;font-size:13px;\">\n<p>Jeśli zamówiony produkt okazał się nietrafiony, możesz go w łatwy sposób zwrócić. Wystarczy, że skorzystasz z naszej strony zwrotu zakupów, dostępnej pod adresem <a href=\"https://furgonetka.pl/zwroty/f11240c1-2b50-45e7-9a8f-00046fe06e4a\"> https://furgonetka.pl/zwroty/f11240c1-2b50-45e7-9a8f-00046fe06e4a.</a></p>\n<div>\n<div>\n<div style=\"width:212px;\"><img src=\"https://shoper.furgonetka.pl/images/zwroty/shoper_returns_step1.png\" alt=\"Wybierasz produkty do zwrotu\" />\n<p style=\"text-align:center;\"><strong>Wybierasz produkty do zwrotu</strong></p>\n<p style=\"width:164px;text-align:center;margin:auto;\">Możesz zwrócić wszystkie produkty lub tylko niektóre z nich, masz na to 14 dni.</p>\n</div>\n<div style=\"width:212px;\"><img src=\"https://shoper.furgonetka.pl/images/zwroty/shoper_returns_step2.png\" alt=\"Określasz szczegóły przesyłki\" />\n<p style=\"text-align:center;\"><strong>Określasz szczegóły przesyłki</strong></p>\n<p style=\"width:200px;text-align:center;margin:auto;\">Pakujesz produkty do paczki, wybierasz opcję dostawy i opłacasz przesyłkę zwrotną.</p>\n</div>\n</div>\n<div>\n<div style=\"width:212px;\"><img src=\"https://shoper.furgonetka.pl/images/zwroty/shoper_returns_step3.png\" alt=\"Odsyłasz paczkę\" />\n<p style=\"text-align:center;\"><strong>Odsyłasz paczkę</strong></p>\n<p style=\"width:200px;text-align:center;margin:auto;\">Przekazujesz przesyłkę zwrotną kurierowi lub zanosisz ją do  wybranego punktu nadania.</p>\n</div>\n<div style=\"width:212px;\"><img src=\"https://shoper.furgonetka.pl/images/zwroty/shoper_returns_step4.png\" alt=\"Otrzymujesz zwrot pieniędzy\" />\n<p style=\"text-align:center;\"><strong>Otrzymujesz zwrot pieniędzy</strong></p>\n<p style=\"width:212px;text-align:center;margin:auto;\">W ciągu 14 dni otrzymujesz zwrot pieniędzy, o czym zostaniesz poinformowany mailowo.</p>\n</div>\n</div>\n</div>\n<h2>Prawo odstąpienia od umowy</h2>\n<p style=\"text-align:justify;\">Masz prawo odstąpić od umowy bez podania przyczyny. Pamiętaj jednak, że towar nie może posiadać śladów użytkowania. Aby skorzystać z prawa odstąpienia od umowy, poinformuj nas o swojej decyzji w terminie 14 dni od dnia, w którym Ty lub osoba trzecia, inna niż przewoźnik i wskazana przez Ciebie fizycznie otrzymałeś/otrzymała zakupiony towar. Za jednoznaczne oświadczenie uznajemy zarejestrowanie zwrotu na naszej stronie zwrotu zakupów (i taką formę rekomendujemy). Jeśli wolisz, możesz przesłać oświadczenie o odstąpieniu pocztą elektroniczną na adres kontakt@motkomania.pl lub tradycyjną na adres:</p>\nMotkomania.pl<br />Storczykowa 5<br />83-050 Bielkowo<br />\n<p style=\"text-align:justify;\">Prawo odstąpienia od umowy nie przysługuje Kupującemu w wypadkach określonych szczegółowo w art. 38 ust. 1 ustawy z dnia 30 maja 2014 r. o prawach konsumenta.</p>\n<h2>Zwrot pieniędzy</h2>\n<p style=\"text-align:justify;\">W przypadku odstąpienia od umowy, zwrócimy Ci kwotę zapłaconą za towar oraz koszt dostawy (z wyjątkiem dodatkowych kosztów, wynikających z wybranego sposobu dostarczenia innego, niż najtańszy zwykły sposób dostarczenia oferowany w naszym sklepie), w terminie 14 dni, w którym otrzymaliśmy oświadczenie o odstąpieniu od umowy.<br />Zastrzegamy sobie możliwość wstrzymania się ze zwrotem płatności do chwili otrzymania zwracanych towarów lub dostarczenia dowodu ich odesłania.<br />Jeśli wybierzesz zwrot za pośrednictwem naszej strony do zwrotu zakupów, dowodem potwierdzającym odesłanie zwracanych towarów będzie status przesyłki zwrotnej, który otrzymamy automatycznie po zgłoszeniu zwrotu.<br />Zwrot płatności zostanie dokonany przy użyciu takich samych sposobów płatności, jak w pierwotnej transakcji, chyba że wyrazisz zgodę na inne rozwiązanie.</p>\n<p style=\"text-align:justify;\">Kupujący ponosi odpowiedzialność za zmniejszenie wartości zwracanych produktów będące wynikiem korzystania z nich w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania produktów. Zastrzegamy sobie prawo do dochodzenia względem Konsumenta z tego tytułu odszkodowania, w zakresie w jakim zezwalają na to obowiązujące przepisy prawa.</p>\n<div style=\"clear:both;\"> </div>\n<h2>Zwrot towaru</h2>\n<p style=\"text-align:justify;\">Zwracane przedmioty należy odesłać lub przekazać do naszego sklepu niezwłocznie, a w każdym razie nie później, niż 14 dni od dnia, w którym poinformowałeś nas o odstąpieniu od umowy. Termin uznajemy za zachowany, jeżeli rzecz zostanie odesłana przed upływem terminu 14 dni.<br />Koszt odesłania towaru do naszego sklepu ponosi osoba zwracająca.</p>\n<p>Zwracane przedmioty należy odesłać na adres:<br />Motkomania.pl<br />Storczykowa 5<br />83-050 Bielkowo</p>\n</div>\n</div>\n</div>\n<p></p>','reklamacje-i-zwroty'),(9,2,1,'Reklamacje i zwroty','','','','','reklamacje-i-zwroty'),(10,1,1,'Jak kupować?','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<h3><strong>Krok 1 - Wybór produktów</strong></h3>\n<p><strong> </strong></p>\n<ul>\n<li>przeglądaj listę kategorii lub skorzystaj z wyszukiwarki, aby znaleźć odpowiedni produkt,</li>\n<li>przy każdym produkcie znajdziesz szczegółowe informacje na jego temat,</li>\n<li>pamiętaj, że zarejestrowani klienci mogą zapamiętać produkty w przechowalni,</li>\n<li>po znalezieniu interesującego Ciebie produktu, dodaj go do koszyka,</li>\n<li>jeżeli kompletowanie zamówienia jest zakończone - przejdź do koszyka.</li>\n</ul>\n<p> </p>\n<h3><strong>Krok 2 - Zawartość koszyka</strong></h3>\n<p><strong> </strong></p>\n<ul>\n<li>w koszyku zobaczysz dokładnie, jakie wybrałeś produkty i w jakiej ilości,</li>\n<li>zmień wartość w kolumnie ilość i kliknij na \"przelicz\", aby dopasować zamówienie,</li>\n<li>klikając na ikonę minusa usuniesz produkty z koszyka,</li>\n<li>wybierz odpowiadającą Ci formę dostawy i płatności,</li>\n<li>jeżeli posiadasz kupon rabatowy, wprowadź go poniżej, aby otrzymać zniżkę,</li>\n<li>potwierdź wybrane opcje klikając na przycisk „zamawiam”.</li>\n</ul>\n<p> </p>\n<h3><strong>Krok 3 - Składanie zamówienia</strong></h3>\n<p><strong> </strong></p>\n<ul>\n<li>jeżeli posiadasz konto w naszym sklepie, podaj dane logowania i kliknij na \"zaloguj się\",</li>\n<li>jeżeli nie posiadasz konta, wybierz opcję \"zarejestruj się\" lub pomiń zakładanie konta klikając na \"złóż zamówienie\"; pamiętaj, że rejestracja pozwoli Ci korzystać z wielu przywilejów, w tym:\n<ul>\n<li>podgląd statusu realizacji zamówień oraz historii zakupów,</li>\n<li>brak konieczności ponownego wprowadzania danych przy kolejnych zakupach,</li>\n<li>możliwość otrzymywania indywidualnych rabatów i kuponów promocyjnych.</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li>wprowadź Twoje imię i nazwisko oraz informacje teleadresowe,</li>\n<li>aby zamówienie wysłać na inny adres, zaznacz \"inny adres wysyłki\" i podaj odpowiednie dane,</li>\n<li>ewentualne dodatkowe informacje o realizacji zamówienia umieść w polu \"uwagi\"</li>\n<li>po kliknięciu na \"Podsumowanie\" zobaczysz komplet podanych przez Ciebie informacji,</li>\n<li>kliknięcie na przycisku \"Złóż zamówienie\" oznacza potwierdzenie zakupu,</li>\n<li>odbierz wiadomość email i kliknij na link potwierdzający złożenie zamówienia.</li>\n</ul>\n<p> </p>\n<p>Pamiętaj, że zarejestrowani klienci mogą w swoim koncie śledzić status realizacji złożonych zamówień.</p>\n<p> </p>\n<h3><strong>Produkty dostępne na zamówienie<br /></strong></h3>\n<p>Zadzwoń lub napisz na <a href=\"mailto:kontakt@motkomania.pl,\">kontakt@motkomania.pl.</a></p>\n</div>\n</div>\n<p></p>','jak-kupowac'),(10,2,1,'Jak kupować?','','','','','jak-kupowac'),(11,1,1,'Regulamin','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<h3 style=\"text-align:center;\"><strong>REGULAMIN SKLEPU INTERNETOWEGO</strong></h3>\n<h3 style=\"text-align:center;\"> </h3>\n<p> </p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§1</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Postanowienia ogólne</strong></h3>\n<p> </p>\n<p>1. Sklep internetowy [dalej „Sklep”] prowadzi sprzedaż detaliczną za pośrednictwem Internetu, na podstawie niniejszego Regulaminu [dalej „Regulamin”].</p>\n<p>2. Właścicielem Sklepu jest: Dulcis Łukasz Cichowski-Kopczyński z siedzibą w Gdyni<em>, </em>przy ul. Armii Krajowej 21/40<em>,</em> NIP: 5862104355, tel. +48 600 256 864, adres e-mail: kontakt@motkomania.pl.</p>\n<p>3. Regulamin jest integralną częścią umowy sprzedaży zawieranej z Klientem.</p>\n<p>4. Warunkiem zawarcia umowy sprzedaży jest akceptacja Regulaminu przez Klienta.</p>\n<p>5. Ceny podane w Sklepie są cenami brutto (zawierają podatek VAT).</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§2</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Zamówienia</strong></h3>\n<p> </p>\n<p>1. Zamówienia można składać w następujący sposób:</p>\n<p style=\"padding-left:30px;\">a) poprzez formularz dostępny na stronie internetowej Sklepu,</p>\n<p style=\"padding-left:30px;\">b) e-mailem na adres dostępny na stronie internetowej Sklepu,</p>\n<p style=\"padding-left:30px;\">c) telefonicznie na numery przeznaczone do składania zamówień, dostępne na stronie internetowej Sklepu w zakładce Kontakt.</p>\n<p>2. Warunkiem realizacji zamówienia jest podanie przez Klienta danych pozwalających na weryfikację Klienta i odbiorcy towaru. Sklep potwierdza przyjęcie zamówienia e-mailem lub telefonicznie. Sklep ma prawo odmówić przyjęcia zamówienia, ograniczyć sposób płatności lub żądać przedpłaty w przypadku, gdy zamówienie budzi uzasadnione wątpliwości co do prawdziwości i rzetelności podanych danych bądź sposobu zapłaty.</p>\n<p>3. Dla stron wiążące są informacje zawarte na stronie internetowej Sklepu przy kupowanym towarze w momencie złożenia zamówienia, w szczególności: cena, charakterystyka towaru, jego cechy, elementy wchodzące w skład zestawu, termin i sposób dostawy. Sklep dokłada wszelkich starań, aby jeśli to możliwe produkty zakupione w ramach jednej transakcji pochodziły z jednej partii produkcyjnej. Produkty z różnych partii wysyłane są tylko w przypadku, gdy dana ilość nie jest dostępna w jednej partii. Poszczególne sztuki mogą się różnić kolorem w ramach jednej partii produkcyjnej, ma to miejsce w szczególności w przypadku produktów ręcznie farbowanych.</p>\n<p>4. Informacje znajdujące się na stronie internetowej Sklepu nie stanowią oferty w rozumieniu Kodeksu Cywilnego.</p>\n<p>5. Promocje organizowane przez Właściciela Sklepu nie dotyczą produktów producenta Ashford, chyba, że w opisie promocji oznaczono inaczej.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§3</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Płatności</strong></h3>\n<p> </p>\n<p>1. Klient ma do wyboru formy płatności określone w zakładce Formy płatności.</p>\n<p>2. Ceny przesyłek określone są w cenniku dostawy.</p>\n<p>3. Warunkiem wydania towaru jest zapłata za towar i przesyłkę. Wszelkie płatności za zamówienia dokonane za pośrednictwem sklepu należy dokonywać na rachunek bankowy o nr 85 1870 1045 2078 1146 0222 0001. Zamówienie nieopłacone w ciągu 14 dni od daty jego złożenia jest uważane za anulowane. Operatorem płatności jest Autopay S.A. oraz PayPro.</p>\n<p>4. W przypadku zakupu produktów dostępnych na zamówienie przed jego realizacją pobierana jest zaliczka w wysokości 50% wartości całkowitej zakupu.</p>\n<p>5. W przypadku produktów dostępnych na zamówienie, a stanowiących narzędzie, urządzenie, wyposażenie, akcesoria, produkowanych na zamówienie klienta lub farbowanych na specjalne zamówienie klienta przed przystąpieniem do realizacji zamówienia konieczne jest jego opłacenie w całości.</p>\n<p>6. Typy obsługiwanych kart płatniczych: Visa, Visa Electron, Maestro, MasterCard, MasterCard Electronic.</p>\n<p> </p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§4</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Wysyłka towaru</strong></h3>\n<p> </p>\n<p>1. Zamówiony towar Sklep wysyła za pośrednictwem firm wysyłkowych (np. Poczty Polskiej lub firmy kurierskiej) lub udostępnia do odbioru przez klienta w siedzibie firmy po opłaceniu zamówieniu przez klienta i telefonicznej lub elektronicznej wiadomości od klienta o planowanym terminie odbioru.</p>\n<p>2. Niewskazanie lub nieprawidłowe wskazanie adresu dostawy może opóźnić realizację zamówienia oraz termin dostawy.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§5</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Reklamacje</strong></h3>\n<p> </p>\n<p>1. <span class=\"BxUVEf ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">Odpowiedzialność sprzedawcy z tytułu niezgodności towaru z umową trwa 2 lata od dnia wydania towaru</span></span>.</p>\n<p>2. Podstawą przyjęcia reklamacji jest przedstawienie przez Klienta dowodu zakupu towaru.</p>\n<p>3. W przypadku niezgodności towaru z umową Klient powinien odesłać do Sklepu reklamowany towar wraz z opisem niezgodności.</p>\n<p>4. Sklep ustosunkowuje się do reklamacji Klienta w terminie 14 dni roboczych od momentu zwrotu towaru wraz z opisem niezgodności. W przypadku, gdy weryfikacja niezgodności wymaga zasięgnięcia opinii biegłego, bądź przedstawiciela producenta towaru, termin do ustosunkowania się Sklepu ulega przedłużeniu o czas uzyskania przez Sklep takiej opinii.</p>\n<p>5. Gdy realizacja uzasadnionej reklamacji wiąże się z wysłaniem Klientowi nowego towaru bądź usunięcia niezgodności, koszty dostaw ponosi Sklep.</p>\n<p>6. Indywidualne ustawienia komputera i monitora Klienta powodujące błędne lub zniekształcone wyświetlanie informacji o towarach (np. kolorów), nie mogą być podstawą reklamacji, jak również nie podlegają reklamacji zmiany kolorów i struktury w trakcie użytkowania produktów lub wiązania w przędzy.</p>\n<p>7. W przypadku produktów farbowanych ręcznie, jakość farbowania, wybarwienie i trwałość koloru nie może być podstawą reklamacji.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§6</strong></h3>\n<h3 style=\"text-align:center;\"><strong>Prawo odstąpienia od umowy</strong></h3>\n<p> </p>\n<p>1. Na podstawie Ustawy o prawach konsumentów z dnia 30 maja 2014 r. Klient ma prawo odstąpienia od umowy.</p>\n<p>2. Prawo odstąpienia od umowy jest skuteczne jeżeli Klient złoży Sklepowi, w terminie 14 dni od odbioru towaru, oświadczenie o odstąpieniu od umowy.</p>\n<p>3. Klient zwraca towar do Sklepu w terminie 14 dni od złożenia oświadczenia o odstąpieniu od umowy. Zwrócony towar powinien być w stanie nienaruszonym, w tym powinien być kompletny, w fabrycznym opakowaniu, nie może nosić śladów eksploatacji. Koszty przesyłki zwracanego towaru ponosi Klient.</p>\n<p>4. W ciągu 3 dni roboczych od otrzymania przesyłki, Sklep sprawdzi stan przekazanego produktu.</p>\n<p>5. W terminie 14 dni od sprawdzenia towaru Sklep zwraca Klientowi zapłaconą kwotę, pomniejszoną o koszty realizacji zamówienia. Klient powinien wskazać numer rachunku bankowego, na jaki ma zostać przelana zwracana kwota. W przypadku płatności kartą płatniczą zwrot środków zostanie wykonany na kartę.</p>\n<p>6. W przypadku naruszenia przez Klienta warunków określonych w ust 2 i 3 powyżej oświadczenie o odstąpieniu od umowy jest bezskuteczne, towar nie podlega zwrotowi, a Sklep nie zwraca Klientowi zapłaconej kwoty.</p>\n<p>7. Prawo odstąpienia nie przysługuje Klientowi w przypadkach określonych w art. 10 ust. 3 ustawy określonej w ust. 1 powyżej, tj. w zakresie:</p>\n<p style=\"padding-left:30px;\">a) świadczenia usług rozpoczętych, za zgodą Klienta, przed upływem terminu odstąpienia od  umowy (dotyczy przypadków świadczenia usług, a nie sprzedaży towarów),</p>\n<p style=\"padding-left:30px;\">b) nagrań audialnych i wizualnych oraz zapisanych na informatycznych nośnikach danych po usunięciu przez Klienta ich oryginalnego opakowania,</p>\n<p style=\"padding-left:30px;\">c) umów dotyczących świadczeń, za które cena lub wynagrodzenie zależy wyłącznie od ruchu cen na rynku finansowym,</p>\n<p style=\"padding-left:30px;\">d) świadczeń o właściwościach określonych przez Klienta w złożonym przez niego zamówieniu lub ściśle związanych z jego osobą,</p>\n<p style=\"padding-left:30px;\">e) świadczeń, które z uwagi na ich charakter nie mogą zostać zwrócone lub których przedmiot ulega szybkiemu zepsuciu,</p>\n<p style=\"padding-left:30px;\">f) dostarczania prasy,</p>\n<p style=\"padding-left:30px;\">g) usług w zakresie gier hazardowych</p>\n<p style=\"padding-left:30px;\">h) produktów wykonywanych na zamówienie oraz produktów sprowadzanych na zamówienie.</p>\n<p>  <strong> </strong></p>\n<h3 style=\"text-align:center;\"><strong>§7</strong><strong> </strong></h3>\n<h3 style=\"text-align:center;\"><strong>Ochrona prywatności</strong></h3>\n<p> </p>\n<p>1. Składając zamówienie Klient wyraża zgodę na przetwarzanie jego danych osobowych wyłącznie w celu realizacji zamówienia.</p>\n<p>2. Klient może również wyrazić odrębną zgodę na otrzymywanie od Sklepu materiałów reklamowo - promocyjnych, w tym biuletynu handlowego.</p>\n<p>3. Klient ma prawo wglądu do swoich danych i ich korekty, a także do żądania usunięcia.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§8</strong></h3>\n<h3 style=\"text-align:center;\">Własność intelektualna</h3>\n<p> </p>\n<p>Zabrania się wykorzystywania jakichkolwiek materiałów publikowanych na stronie internetowej Sklepu (w tym zdjęć i opisów towarów) bez pisemnej zgody Sklepu.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><strong>§9</strong></h3>\n<h3 style=\"text-align:center;\">Wejście w życie i zmiany Regulaminu</h3>\n<p> </p>\n<p>1. Regulamin wchodzi w życie z dniem publikacji na stronie internetowej Sklepu.</p>\n<p>2. Sklep zastrzega sobie możliwość zmian w Regulaminie, które wchodzą w życie z dniem ich publikacji na stronie internetowej Sklepu. Do umów zawartych przed zmianą Regulaminu stosuje się wersję Regulaminu obowiązującą w dacie złożenia Zamówienia przez Klienta.</p>\n</div>\n</div>\n<p></p>','regulamin'),(11,2,1,'Regulamin','','','','','regulamin'),(12,1,1,'Polityka cookies','','','','<p>Fragmenty polityki cookies chronione są prawem autorskim, które przysługują IAB Polska, źródło http://wszystkoociasteczkach.pl/.</p>\n<table>\n<tbody>\n<tr>\n<td style=\"vertical-align:top;\" colspan=\"11\">\n<div id=\"documentLine_68368\" class=\"typParagraf\" style=\"margin:15px 0px;text-align:center;font-weight:bold;\">\n<div>Polityka Cookies</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">1.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div>\n<div>Niniejsza Polityka Cookies określa zasady przechowywania i dostępu do informacji na urządzeniach Użytkownika za pomocą plików Cookies, służących realizacji usług świadczonych drogą elektroniczną żądanych przez Użytkownika, przez Dulcis Łukasz Cichowski-Kopczyński, Gdynia.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td style=\"vertical-align:top;\" colspan=\"11\">\n<div id=\"documentLine_68370\" class=\"typParagraf\" style=\"margin:15px 0px;text-align:center;font-weight:bold;\">\n<div style=\"margin:15px 0px;\">§ 1 Definicje</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">1.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68371\">\n<div><strong> Administrator</strong> - oznacza Dulcis Łukasz Cichowski-Kopczyński, który świadczy usługi drogą elektroniczną oraz przechowuje i uzyskuje dostęp do informacji w urządzeniach Użytkownika.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">2.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68372\">\n<div><strong>Cookies</strong> - oznacza dane informatyczne, w szczególności niewielkie pliki tekstowe, zapisywane i przechowywane na urządzeniach za pośrednictwem których Użytkownik korzysta ze stron internetowych Serwisu.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">3.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68373\">\n<div><strong>Cookies Administratora</strong> - oznacza Cookies zamieszczane przez Administratora, związane ze świadczeniem usług droga elektroniczną przez Administratora za pośrednictwem Serwisu.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">4.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68374\">\n<div><strong>Cookies Zewnętrzne</strong> - oznacza Cookies zamieszczane przez partnerów Administratora, za pośrednictwem strony internetowej Serwisu.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">5.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68375\">\n<div><strong>Serwis</strong> - oznacza stronę internetową, pod którą Administrator prowadzi serwis internetowy, działającą w domenie motkomania.pl.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">6.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68376\">\n<div><strong>Urządzenie</strong> - oznacza elektroniczne urządzenie za pośrednictwem, którego Użytkownik uzyskuje dostęp do stron internetowych Serwisu.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">7.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68377\">\n<div><strong>Użytkownik</strong> - oznacza podmiot, na rzecz którego zgodnie z Regulaminem i przepisami prawa mogą być świadczone usługi drogą elektroniczną lub z którym zawarta może być Umowa o świadczenie usług drogą elektroniczną.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td style=\"vertical-align:top;\" colspan=\"11\">\n<div id=\"documentLine_68378\" class=\"typParagraf\" style=\"margin:15px 0px;text-align:center;font-weight:bold;\">\n<div style=\"margin:15px 0px;\">§ 2 Rodzaje wykorzystywanych Cookies</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">1.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68379\">\n<div>Stosowane przez Administratora Cookies są bezpieczne dla Urządzenia Użytkownika. W szczególności tą drogą nie jest możliwe przedostanie się do Urządzeń Użytkowników wirusów lub innego niechcianego oprogramowania lub oprogramowania złośliwego. Pliki te pozwalają zidentyfikować oprogramowanie wykorzystywane przez Użytkownika i dostosować Serwis indywidualnie każdemu Użytkownikowi. Cookies zazwyczaj zawierają nazwę domeny z której pochodzą, czas przechowywania ich na Urządzeniu oraz przypisaną wartość.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">2.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">Pliki cookies wykorzystywane są w celu:\n<p>a)      dostosowania zawartości stron internetowych Serwisu do preferencji Użytkownika oraz optymalizacji korzystania ze stron internetowych; w szczególności pliki te pozwalają rozpoznać urządzenie Użytkownika Serwisu i odpowiednio wyświetlić stronę internetową, dostosowaną do jego indywidualnych potrzeb;</p>\n<p>b)      tworzenia statystyk, które pomagają zrozumieć, w jaki sposób Użytkownicy Serwisu korzystają ze stron internetowych, co umożliwia ulepszanie ich struktury i zawartości;</p>\n<p>c)       utrzymanie sesji Użytkownika Serwisu (po zalogowaniu), dzięki której Użytkownik nie musi na każdej podstronie Serwisu ponownie wpisywać loginu i hasła;</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"3\">   3.</td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\"> </td>\n<td style=\"vertical-align:top;\" colspan=\"7\">Strona wykorzystuje dwa rodzaje plików:</td>\n</tr>\n<tr>\n<td colspan=\"3\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">a)</td>\n<td style=\"vertical-align:top;\" colspan=\"7\">\n<div id=\"documentLine_68381\">\n<div><strong>Cookies sesyjne</strong>: są przechowywane na Urządzeniu Użytkownika i pozostają tam do momentu zakończenia sesji danej przeglądarki. Zapisane informacje są wówczas trwale usuwane z pamięci Urządzenia. Mechanizm cookies sesyjnych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z Urządzenia Użytkownika.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"3\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">b)</td>\n<td style=\"vertical-align:top;\" colspan=\"7\">\n<div id=\"documentLine_68382\">\n<div><strong>Cookies trwałe</strong>: są przechowywane na Urządzeniu Użytkownika i pozostają tam do momentu ich skasowania. Zakończenie sesji danej przeglądarki lub wyłączenie Urządzenia nie powoduje ich usunięcia z Urządzenia Użytkownika. Mechanizm cookies trwałych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z Urządzenia Użytkownika.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">4.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68383\">\n<div>Użytkownik ma możliwość ograniczenia lub wyłączenia dostępu plików cookies do swojego Urządzenia. W przypadku skorzystania z tej opcji korzystanie ze Serwisu będzie możliwe, poza funkcjami, które ze swojej natury wymagają plików cookies.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">5.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div id=\"documentLine_68406\">\n<div>Użytkownik może w każdej chwili usunąć pliki Cookies korzystając z dostępnych funkcji w przeglądarce internetowej, której używa.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">6.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div>\n<div>Pliki cookies zamieszczane w urządzeniu końcowym Użytkownika Serwisu i wykorzystywane mogą być również przez współpracujących z operatorem Serwisu reklamodawców oraz partnerów.</div>\n</div>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n<td style=\"vertical-align:top;width:10pt;\" nowrap=\"nowrap\">7.</td>\n<td style=\"vertical-align:top;\" colspan=\"8\">\n<div>\n<div>Ograniczenie stosowania plików Cookies, może wpłynąć na niektóre funkcjonalności dostępne na stronie internetowej Serwisu.</div>\n</div>\n</td>\n</tr>\n</tbody>\n</table>\n<p></p>','polityka-cookies'),(12,2,1,'Polityka cookies','','','','','polityka-cookies'),(13,1,1,'Częste pytania','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<div>\n<p>Poniżej znajdują się przygotowane przez nas odpowiedzi na najczęściej zadawane pytania, dotyczące przeprowadzania zakupów w naszym sklepie.</p>\n<p><span style=\"font-size:x-small;\"><strong>Kliknij na interesującym Ciebie pytaniu:</strong></span></p>\n</div>\n<ul>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_dostepnosc\">Jak sprawdzić dostępność produktów?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_stan\">Jak sprawdzić stan realizacji zamówienia?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_dostawa-czas\">Jak długo będę czekać na przesyłkę?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_dostawa-formy\">Jakie występują formy dostawy?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_dostawa-cena\">Ile zapłacę za przesyłkę?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_platnosc\">Jak zapłacić za zamówienie?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_odbior\">Czy mogę osobiście odebrać zamówienie?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_kupony\">Co to są kupony rabatowe?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_przechowalnia\">Co to jest przechowalnia?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_vat\">Czy mogę otrzymać fakturę VAT?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_edycja\">Jak zmienić moje zamówienie?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_anulowanie\">Złożyłem błędne zamówienie. Jak je anulować?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_przesylka\">Gdzie jest moja przesyłka?</a></li>\n<li style=\"margin-bottom:3px;\"><a href=\"#user_zwrot\">Czy mogę zwrócić zakupiony produkt?</a></li>\n</ul>\n<p> </p>\n<p><a href=\"https://motkomania.pl/czeste-pytania#zwrot\"> </a></p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<p><a href=\"https://motkomania.pl/czeste-pytania#zwrot\"> </a></p>\n<p> </p>\n<p> </p>\n<h3 id=\"user_dostepnosc\">Jak sprawdzić dostępność produktów?</h3>\n<p> </p>\n<p>Przy każdym z produktów znajduje się informacja o jego dostępności w sklepie:</p>\n<ul>\n<li style=\"margin-bottom:10px;\">Brak towaru – chwilowo 0 sztuk na magazynie; jeżeli jesteś bardzo zainteresowany tym produktem, daj nam znać poprzez email: <strong><em>kontakt@motkomania.pl</em></strong> lub telefonicznie: <strong><em>+48.600256864</em></strong></li>\n<li style=\"margin-bottom:10px;\">Na wyczerpaniu – ostatnie sztuki danego towaru, warto się pospieszyć z zakupem!</li>\n<li style=\"margin-bottom:10px;\">Średnia ilość – mamy przynajmniej kilka/kilkanaście egzemplarzy</li>\n<li style=\"margin-bottom:10px;\">Duża ilość – w magazynie mamy wystarczającą ilość produktu, aby obsłużyć wiele zamówień</li>\n<li style=\"margin-bottom:10px;\">Dostępny na zamówienie – możemy specjalnie dla Ciebie sprowadzić ten produkt - skontaktuj się z nami drogą email: <strong><em>kontakt@motkomania.pl</em></strong> lub telefonicznie: <strong><em>+48.600256864</em></strong></li>\n<li style=\"margin-bottom:10px;\">Spodziewana dostawa – produkt będzie dostępny już wkrótce</li>\n<li style=\"margin-bottom:10px;\">Wycofany z oferty – produkt nie jest już dostępny w ofercie naszego sklepu</li>\n</ul>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_stan\">Jak sprawdzić stan realizacji zamówienia?</h3>\n<p> </p>\n<p>Na Twój adres email będziemy przesyłać informacje o postępach w realizacji Twojego zamówienia.  Ponadto po zalogowaniu do Twojego konta będziesz miał dostęp do wszelkich informacji o Twoich bieżacych oraz już zrealizowanych zamówieniach: statusie, zawartości, podanych adresach, itp.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_dostawa-czas\">Jak długo będę czekać na przesyłkę?</h3>\n<p> </p>\n<p>Natychmiast po złożeniu przez Ciebie zamówienia otrzymasz na adres email informacje z linkiem, który należy kliknąć, aby potwierdzić zamówienie - wtedy też rozpoczynamy proces jego realizacji. Na Twój adres email na bieżąco będą przesyłane informacje o stanie realizacji Twojego zamówienia.</p>\n<p> </p>\n<h3 style=\"text-align:center;\"><span style=\"color:#808080;\"><strong>Termin otrzymania paczki = termin wysyłki + czas dostawy</strong></span></h3>\n<p> </p>\n<p>Termin wysyłki wynika z dostępności produktów i wybranej formy płatności, podczas gdy czas dostawy zależy od wybranej przez Ciebie formy dostawy.</p>\n<p style=\"text-align:right;\"><strong>» <a href=\"6-czas-realizacji-zamowienia\">szczegółowy opis realizacji zamówień</a></strong></p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_dostawa-formy\">Jakie występują formy dostawy?</h3>\n<p> </p>\n<p>W zależności od ilości i wagi zamawianych przez Ciebie produktów, wybranej formy płatności i własnych preferencji, możesz wybrać jedną z form dostawy:</p>\n<ul>\n<li>dostawa na terenie Trójmiasta pod wskazany adres,</li>\n<li>poczta polska (przesyłka ekonomiczna lub priorytetowa),</li>\n<li>odbiór osobisty w Bielkowie (Storczykowa 5) lub w Gdyni (Armii Krajowej 21/40)</li>\n</ul>\n<p style=\"text-align:right;\"><strong>» <a href=\"8-koszty-dostawy\">szczegółowy opis form dostawy</a></strong></p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_dostawa-cena\">Ile zapłacę za przesyłkę?</h3>\n<p> </p>\n<p>Całkowity koszt dostawy zamówienia poznasz po dodaniu produktów do koszyka i wybraniu interesującej Ciebie formy dostawy i metody płatności - w podsumowaniu zobaczysz dokładną wartość do zapłaty. W zależności od wybranej formy płatności (przedpłata lub płatność za pobraniem) oraz sposobu dostawy, koszt przesyłki wynosi od kilku do kilkunastu złotych.</p>\n<p> </p>\n<p style=\"text-align:right;\"><strong>» <a href=\"8-koszt-dostawy\">szczegółowy cennik dostaw</a></strong></p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_platnosc\">Jak zapłacić za zamówienie?</h3>\n<p> </p>\n<p>W chwili obecnej jedyną formą płatności za zamówione produkty jest płatność przelewem lub za pośrednictwem serwisu PayU.</p>\n<p style=\"text-align:right;\"><strong>» <a href=\"7-formy-platnosci\">szczegółowy opis form płatności</a></strong></p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_odbior\">Czy mogę osobiście odebrać zamówienie?</h3>\n<p> </p>\n<p>Oczywiście, możesz odebrać zamówienie w punkcie odbioru osobistego, znajdującym się pod adresem: <em>Storczykowa 5, 83-050 Bielkowo </em>lub<em> Armii Krajowej 21/40, 81-393 Gdynia</em> Godziny pracy punktu znajdziesz w zakładce Kontakt.<strong> </strong> Przy odbiorze osobistym nie ponosisz dodatkowych kosztów. Prosimy jednak o wcześniejszą informację mailową lub telefoniczną o planowanym terminie odbioru.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_kupony\">Co to są kupony rabatowe?</h3>\n<p> </p>\n<p>W wielu akcjach promocyjnych oferujemy naszym Klientom kupony rabatowe. Mają one formę  kodów, które należy wpisać w koszyk, w odpowiednio oznaczonym polu. Spowoduje to przeliczenie kwoty do zapłaty z uwzględnieniem rabatu. </p>\n<p>Pamiętaj, że większość kodów rabatowych ma swój okres ważności. Po jego wygaśnięciu kod rabatowy przestaje być aktywny – nie spowoduje przyznania określonego rabatu.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_przechowalnia\">Co to jest przechowalnia?</h3>\n<p> </p>\n<p>Przechowalnia to miejsce, do którego możesz dodawać produkty, nad którymi się zastanawiasz. Dostęp do tej funkcjonalności mają <strong>tylko zalogowani użytkownicy. </strong></p>\n<p>Jeżeli wahasz się, czy kupić dany produkt, a posiadasz konto w naszym sklepie, zaloguj się i dodaj produkt do przechowalni. Produkty w przechowalni są dla Ciebie zapamiętywane. Przy kolejnym zalogowaniu do sklepu w przechowalni znajdziesz wszystkie zapisane przez Ciebie produkty. W każdej chwili możesz powrócić do nich, przerzucić je do koszyka lub usunąć z przechowalni.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_vat\">Czy mogę otrzymać fakturę VAT?</h3>\n<p> </p>\n<p>Tak, na zakupione w naszym sklepie produkty możesz otrzymać fakturę VAT. W tym celu w trakcie składania zamówienia w formularzu z Twoimi danymi wybierz opcję „firma” i podaj dane do faktury. Informacje na temat chęci otrzymania faktury VAT umieść w Uwagach (sekcja \"Dodatkowe informacje\"). Jeżeli adres wysyłki jest inny, niż dane do faktury, zaznacz w formularzu opcję „inny adres wysyłki” i podaj adres, na który ma być przesłane zamówienie.</p>\n<p>Data wystawienia faktury VAT to data wysyłki Twojego zamówienia. Nie ma możliwości zmiany tej daty.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_edycja\">Jak zmienić moje zamówienie?</h3>\n<p> </p>\n<p>Możesz modyfikować swoje zamówienia jedynie do momentu skompletowania jego zawartości. W momencie przesłania go na wskazany adres modyfikacja jest już niemożliwa. W celu jakiejkolwiek modyfikacji swojego zamówienia (zmiana adresu, dodanie produktu do zamówienia, zmiana sposobu płatności czy dostawy), skontaktuj się z nami jak najszybciej - najlepiej telefonicznie: <strong><em>+48.600256864</em></strong> lub elektronicznie: kontakt@motkomania.pl, zamowienia@motkomania.pl.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_anulowanie\">Złożyłem błędne zamówienie. Jak je anulować?</h3>\n<p> </p>\n<p>Możesz anulować swoje zamówienia jedynie do momentu skompletowania jego zawartości. W momencie przesłania go na wskazany adres anulowanie jest niemożliwe. W celu anulowania zamówienia skontaktuj się z nami jak najszybciej - najlepiej telefonicznie: <strong><em>+48.600256864</em></strong> lub elektronicznie: kontakt@motkomania.pl, zamowienia@motkomania.pl.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_przesylka\">Gdzie jest moja przesyłka?</h3>\n<p> </p>\n<p>W niektórych przypadkach otrzymasz e-mail z nr Twojej przesyłki. Możesz wówczas śledzić swoją przesyłkę na stronie internetowej firmy świadczącej usługę.</p>\n<p> </p>\n<hr style=\"width:60%;\" />\n<p> </p>\n<h3 id=\"user_zwrot\">Czy mogę zwrócić zakupiony produkt?</h3>\n<p> </p>\n<p>Tak, zgodnie z Ustawą z dnia 2 marca 2000 roku, w ciągu 10 dni od daty odebrania przesyłki z zamówieniem, możesz zwrócić zakupiony w sklepie internetowym produkt bez podania przyczyny. Taki towar nie może jednak nosić śladów używania, nie może być zniszczony czy uszkodzony, musi znajdować się w oryginalnym opakowaniu z jego całą zawartością.</p>\n<p style=\"text-align:right;\"><strong>» <a href=\"9-reklamacje-i-zwroty\">opis reklamacji i zwrotów</a></strong></p>\n</div>\n</div>\n<p></p>','czeste-pytania'),(13,2,1,'Częste pytania','','','','','czeste-pytania'),(14,1,1,'Polityka prywatności','','','','<div class=\"innerbox\">\n<div class=\"resetcss\">\n<h2 style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Polityka prywatności sklepu <em>Motkomania</em></span></h2>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\"><em> </em></span></p>\n<h4 style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Zapewniamy naszym Klientom pełne poszanowanie ich prywatności oraz ochronę ich danych osobowych.</span></h4>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\"> </span></p>\n<p id=\"user_Administrator\" style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\"><strong>Administrator </strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Administratorem danych osobowych osób korzystających ze strony <a href=\"http://www.motkomania.pl\" target=\"_blank\" rel=\"noreferrer noopener\">www.motkomania.pl</a>, w tym Kupujących i Użytkowników, jest Dulcis Łukassz Cichowski-Kopczyński z siedzibą przy ul. Armii Krajowej 21/40, 81-393 Gdynia REGON<span class=\"st\"> 221860349</span>, NIP: 586-210-43-55 („Administrator”).</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Administrator przetwarza dane osobowe zgodnie z wymogami Rozporządzenia Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (dalej jako „RODO”)</span></p>\n<p id=\"user_GromadzoneDane\" style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\"><strong>Dane</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Gromadzone dane osobowe obejmują: imię i nazwisko, nazwa (firma), NIP, adres prowadzenia działalności, adres dostawy i zamieszkania, numer telefonu, e-mail, login i hasło Użytkownika, adres IP komputera z którego dokonano rejestracji lub złożono zamówienie. Dane osobowe gromadzone są przy rejestracji Użytkownika, wypełnianiu formularza Zamówienia, formularza zapisu na newsletter, w trakcie komunikacji za pomocą formularza, e-mail lub telefonicznej.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Zgromadzone dane wykorzystujemy do:</span></p>\n<ul>\n<li style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Świadczenia usługi Konta – przez okres prowadzenia Konta na rzecz Użytkownika, aż do momentu likwidacji Konta Użytkownika na Jego żądanie - art. 6 ust. 1 lit. b) RODO;</span></li>\n<li style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Zawarcia i realizacji umów sprzedaży produktów zawartych za pośrednictwem strony <a href=\"http://www.motkomania.pl\" target=\"_blank\" rel=\"noreferrer noopener\">www.motkomania.pl</a>, e-mail lub telefonicznie – do czasu zakończenia realizacji umowy - art. 6 ust. 1 lit. b) oraz art. 9 ust. 2 lit. h) RODO;</span></li>\n<li style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Wysyłania newslettera</span></li>\n</ul>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Wszystkie dane osobowe są zabezpieczone przed przechwyceniem przez osoby niepożądane poprzez certyfikat bezpieczeństwa SSL.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Jeżeli klient udzielił  zgody na przetwarzanie danych zgodnie z polityką prywatności, może ją w każdej chwili wycofać poprzez usunięcie swojego konta w serwisie <a href=\"http://www.motkomania.pl\" target=\"_blank\" rel=\"noreferrer noopener\">www.motkomania.pl</a>. <span style=\"font-family:Verdana;\">Każdy Klient, który przekazał nam swoje dane osobowe ma pełną możliwość dostępu do swoich danych w celu ich weryfikacji, modyfikacji lub też żądania usunięcia</span> logując się na swoje konto w serwisie. Jeżeli wystąpią trudności z samodzielną zmianą danych lub usunięciem profilu, na prośbę Użytkownika złożoną drogą elektroniczną na adres <a href=\"mailto:kontakt@motkomania.pl\">kontakt@motkomania.pl</a>, zmiany dokonuje Administrator. Osobie, której dane są przetwarzane przysługuje prawo wniesienia skargi do organu ochrony danych osobowych.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Dane osobowe będą również przetwarzane przez podmioty będące podwykonawcami, a w szczególności: firmy świadczące usługi kurierskie i pocztowe oraz podmiot, któremu powierzono przetwarzanie danych osobowych, na podstawie umowy powierzenia. Przekazanie danych osobowych uprawnia ww. podmioty do korzystania z nich jedynie do celów wskazanych przez administratora.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Sklep nie przekazuje, nie sprzedaje ani nie użycza zgromadzonych danych osobowych Klientów osobom trzecim, chyba że dzieje się to za wyraźną zgodą lub na życzenie Klienta albo na żądanie uprawnionych na podstawie prawa organów państwa w związku z toczącymi się postępowaniami.</span></p>\n<p style=\"text-align:justify;\"><strong><span style=\"font-family:arial, helvetica, sans-serif;\">Cookies</span></strong></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Nasz Sklep posługuje się również tzw. plikami cookies (ciasteczka).  Pliki te są zapisywane na komputerze Klienta przez nasz serwer i dostarczają danych statystycznych o aktywności Klienta, w celu dobrania naszej oferty do jego indywidualnych potrzeb i gustów. Klient w każdej chwili może wyłączyć w swojej przeglądarce internetowej opcję przyjmowania cookies, choć musi mieć świadomość, że w niektórych przypadkach odłączenie tych plików może wpłynąć na utrudnienia w korzystaniu z oferty naszego Sklepu.</span></p>\n<p style=\"text-align:justify;\"><strong><span style=\"font-family:arial, helvetica, sans-serif;\">Reklamy</span></strong></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Pragniemy zwrócić Państwa uwagę, że jeżeli na stronie internetowej naszego Sklepu zamieszczamy linki prowadzące do innych, nieadministrowanych przez nas stron internetowych, to nie możemy odpowiadać ani za zawartość tychże stron, ani za stopień ochrony prywatności realizowany przez administratorów tych stron. Podejmując decyzję o przejściu na takie strony, Klient czyni to na własną odpowiedzialność. Zachęcamy przy okazji do zapoznania się z polityką prywatności realizowaną przez te strony, zanim Klient udostępni im swoje dane osobowe.</span></p>\n<p style=\"text-align:justify;\"><span style=\"font-family:arial, helvetica, sans-serif;\">Wszelkie pytania, wnioski i sugestie odnoszące się do ochrony Państwa prywatności, w szczególności danych osobowych prosimy zgłaszać na adres <em>kontakt@motkomania.pl </em>bądź telefonicznie pod numerem <em>+48.600256864</em>.</span></p>\n</div>\n</div>\n<p></p>','polityka-prywatnosci'),(14,2,1,'Polityka prywatności','','','','','polityka-prywatnosci'),(15,1,1,'Kontakt','','','','<p>Przed wysłaniem nam zapytania zajrzyj do sekcji \"Częste pytania\", w której podaliśmy odpowiedzi na najczęściej występujące pytania, związanie z zakupami w naszym sklepie.</p>\n<p><strong>» <a href=\"13-czeste-pytania\">zobacz odpowiedzi na częste pytania</a></strong></p>\n<p> </p>\n<p> </p>\n<h2>Kontakt:</h2>\n<p> </p>\n<p>Wybierz dogodną dla Ciebie metodę kontaktu.</p>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td>Skorzystaj z:</td>\n<td><strong><a href=\"https://localhost:8443/pl/kontakt\">formularza kontaktowego</a></strong></td>\n</tr>\n<tr>\n<td>Wyślij email:      </td>\n<td><strong><a href=\"mailto:kontakt@motkomania.pl\">kontakt@motkomania.pl</a></strong></td>\n</tr>\n<tr>\n<td>Zadzwoń:</td>\n<td><strong>+48.600256864</strong></td>\n</tr>\n</tbody>\n</table>\n<p> </p>\n<p> </p>\n<h2>Nasz adres:</h2>\n<p> </p>\n<p>Dulcis Łukasz Cichowski-Kopczyński</p>\n<p>Armii Krajowej 21/40<br /><br />81-393 Gdynia<br />woj. pomorskie</p>\n<p>nr konta bankowego: 85 1870 1045 2078 1146 0222 0001</p>\n<address> </address><address>Sklep stacjonarny i odbiory osobiste:</address><address> </address><address>Al. Grunwaldzka 515, Gdańsk</address><address> </address><address>pn 14 -19</address><address>wt 10-15</address><address>czw 10-15</address><address>pt 10-15</address><address>sb 10-15</address><address> </address><address>lub tylko odbiory osobiste:</address><address> </address><address>Armii Krajowej 21/40</address><address>31-393 Gdynia</address>\n<p><em>Prosimy o kontakt telefoniczny lub mailowy w celu ustalenia terminu odbioru</em></p>\n<p><br /><br /></p>\n<p></p>','kontakt'),(15,2,1,'Kontakt','','','','','kontakt');
