INSERT INTO `ps_info_lang` VALUES (1,1,1,'<p class=\"custom-text-header\"><span>Motkomania.pl - sklep z najwyższej jakości wełną, włóczkami i akcesoriami</span></p>\n<div class=\"innerbox\">\n<p style=\"text-align:center;\">Motkomania.pl to przytulne miejsce, w którym znajdziesz starannie wyselekcjonowane włóczki, to najwyższa jakość, mnóstwo struktur, szlachetne składy i istne szaleństwo kolorów. Włóczki z różnych zakątków świata. W ofercie znajdują się między innymi włóczki Hedgehog Fibers, Life in the long grass, Malabrigo, ITO, Dyeing House Gallery, Drops i marka własna ręcznie farbowanych włóczek Meme Yarns, która powstała z połączenia wiedzy i zamiłowania do chemicznych eksperymentów oraz miłości do wełny i kolorów.</p>\n<p style=\"text-align:center;\">Ale Motkomania to nie tylko sklep z włóczkami, to również wełna czesankowa, akcesoria dziewiarskie, druty na żyłce, zestawy drutów, szydełka, nożyczki, znaczniki oczek, krosna, gręplarki, kołowrotki i wiele innych. To warsztaty popularyzujące dbałość o tradycję, rękodzieło, i zrównoważony rozwój. Każdy znajdzie tutaj coś dla siebie. Dzierganie i szydełkowanie to wspaniały sposób na spędzenie wolnego czasu a Motkomania pomoże Ci wejść w ten wspaniały, kolorowy świat. To wymarzone miejsce dla miłośniczek i miłośników wszelkich wełnianych aktywności, sklep z włóczkami dla pasjonatów i dla tych, który dopiero chcą rozpocząć swoją przygodę i zacząć od nauki robienia na drutach, nauki tkania czy przędzenia.</p>\n</div>'),(1,1,2,'<h2>Custom Text Block</h2>\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetu</strong></p>\n<p>Sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit.</p>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

